import axios from 'axios';
import React, { useEffect, useState } from 'react'
import { Button, Form } from 'react-bootstrap';
import { useParams } from 'react-router-dom';

const EditarAgricultor = () => {
    const [agricultor, setAgricultor] = useState({
        nombres: '',
        apellidos: '',
        correo: '',
        agremiacion: '',
        matriculai: '',
        rut: ''

    });

    console.log(agricultor)

    function handleInputChange(e) {
      setAgricultor({
          [e.target.name]: e.target.value
        })
    }
    let { id } = useParams();

    useEffect(() => {
      console.log(id); 

      let url = 'http://localhost:4000/agricultor/' + id;
      console.log(id);
      axios.get(url)
      .then(res => {console.log(res)
        const agricultor = res.data;
         console.log(agricultor) 

      });
    })

  agricultor.map((agricult, i) => {
  return (
    <div>
    <Form >
    <Form.Group controlId="nombres">
      <Form.Label>Nombres</Form.Label>
      <Form.Control
         type="text"
         value={agricult.nombres}
         onChange={handleInputChange}
       />
     </Form.Group>

        <Form.Group controlId="apellidos">
          <Form.Label>Apellidos</Form.Label>
          <Form.Control
            type="text"
            value={agricult.apellidos}
            onChange={handleInputChange}
          />
        </Form.Group>

        <Form.Group controlId="correo">
          <Form.Label>Correo</Form.Label>
          <Form.Control
            type="text"
            value={agricult.correo}
            onChange={handleInputChange}
          />

        </Form.Group>

        <Form.Group controlId="cedula">
          <Form.Label>Cedula</Form.Label>
          <Form.Control
            type="text"
            value={agricult.cedula}
            onChange={handleInputChange}
          />
        </Form.Group>

        <Form.Group controlId="contraseña">
          <Form.Label>Contraseña</Form.Label>
          <Form.Control
            type="text"
            value={agricult.contraseña}
            onChange={handleInputChange}
          />
        </Form.Group>

        <Form.Group controlId="agremiacion">
          <Form.Label>Agremiacion</Form.Label>
          <Form.Control
            type="text"
            value={agricult.agremiacion}
            onChange={handleInputChange}
          />

        </Form.Group>
        <Form.Group controlId="matriculai">
        <Form.Label>Matricula I</Form.Label>
        <Form.Control
          type="text"
          value={agricult.matriculai}
          onChange={handleInputChange}
        />

      </Form.Group>
      <Form.Group controlId="Rut">
      <Form.Label>Rut</Form.Label>
      <Form.Control
        type="text"
        value={agricult.rut}
        onChange={handleInputChange}
      />

    </Form.Group>

        <Button
          variant="danger"
          size="lg"
          block="block"
          type="submit"
          className="mt-4"
        >
          Crear Agricultor
        </Button>
      </Form>
  </div>
  );
}) 
}

export default EditarAgricultor
